import React from 'react';

const Action = (props) => {
    return (
        <div>
            <div>
                <button
                    onClick={props.handlePick}
                    disabled={!props.hasOptions}>
                    What should I do?
                        </button>
            </div>
        </div>
    )
}

export default Action
